import React from 'react'

export const LineSvg = () => (
    <svg width='24' height='1' viewBox='0 0 24 1' fill='none' xmlns='http://www.w3.org/2000/svg'>
        <line y1='0.5' x2='24' y2='0.5' stroke='#7F92A0'/>
    </svg>
)
